syntax = "proto3";
import "SimpleUserInfo.proto";
import "WebLiveAssistantType.proto";

package kuaishou.protobuf;

message WebShareFeed {
  string id = 1;
  SimpleUserInfo user = 2;
  uint64 time = 3;
  uint32 thirdPartyPlatform = 4;
  uint64 sortRank = 5;
  WebLiveAssistantType liveAssistantType = 6;
  string deviceHash = 7;

}